import {Container} from 'react-bootstrap';
import Link from "next/link";

const Footer = () => (
    <footer>
        <Container>
            <Link href='/'><a>Home</a></Link> |
            <Link href='/about' prefetch><a>About</a></Link> |
            <Link href='/contact' prefetch><a>Contact</a></Link>
        </Container>
    </footer>
)

export default Footer
